import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';

const PostPage = () => {
    const { id } = useParams();

    useEffect(() => {
        fetch(`http://localhost:4000/post/${id}`)
            .then(response => {
                response.json()
            });
    }, []);

    return (
        <div>
            <h1>post page here</h1>
        </div>
    );
};

export default PostPage;
